import { useEffect, useRef } from 'react';
import picelrain from './pixelrain.module.scss';
const PixelRainComponent = () => {
  const canvasRef = useRef(null);
  useEffect(() => {
    if (!canvasRef) return;
    const ctx = canvasRef.current.getContext('2d');
    canvasRef.current.width = 500;
    canvasRef.current.height = 500;
    const myImage = new Image();
    myImage.src =
      'data:image/png;base64,';

    const canvas = canvasRef.current;

    const numberOfParticles = 5000;
    var pixels;
    let particlesArray = [];
    let mappedImage = [];

    myImage.onload = function () {
      ctx.drawImage(myImage, 0, 0, 500, 500);
      pixels = ctx.getImageData(0, 0, canvas.width, canvas.height);

      //세로로 읽어감
      for (let y = 0; y < canvas.height; y++) {
        let row = [];
        for (let x = 0; x < canvas.width; x++) {
          const red = pixels.data[y * 4 * pixels.width + x * 4];
          const green = pixels.data[y * 4 * pixels.width + x * 4 + 1];
          const blue = pixels.data[y * 4 * pixels.width + x * 4 + 2];
          const brightness = calculateRelativeBrightness(red, green, blue);
          const cell = [brightness];
          row.push(cell);
        }
        mappedImage.push(row);
      }

      function calculateRelativeBrightness(red, green, blue) {
        return (
          Math.sqrt(
            red * red * 0.299 + green * green * 0.587 + blue * blue * 0.114
          ) / 100
        );
      }

      class Particle {
        constructor() {
          this.x = Math.random() * canvas.width;
          this.y = 0;
          this.speed = 0;
          this.velocity = Math.random() * 3.5;
          this.size = Math.random() * 1.5 + 1;
          this.position1 = Math.floor(this.x);
          this.position2 = Math.floor(this.y);
        }
        update() {
          this.position1 = Math.floor(this.x);
          this.position2 = Math.floor(this.y);
          this.speed = mappedImage[this.position1][this.position2];
          let movement = 2.5 - this.speed + this.velocity;

          this.y += movement;
          this.y += this.velocity;
          if (this.y >= canvas) {
            this.y = 0;
            this.x = Math.random() * canvas.width;
          }
        }
        draw() {
          ctx.beginPath();
          ctx.fillStyle = 'white';
          ctx.arc(this.y, this.x, this.size, 0, Math.PI * 2);
          ctx.fill();
        }
      }

      function init() {
        for (let i = 0; i < numberOfParticles; i++) {
          particlesArray.push(new Particle());
        }
      }
      function animate() {
        ctx.globalAlpha = 0.05;
        ctx.fillStyle = 'rgb(0,0,0)';
        ctx.fillRect(0, 0, canvas.width, canvas.height);
        for (let i = 0; i < particlesArray.length; i++) {
          particlesArray[i].update();
          particlesArray[i].draw();
        }
        requestAnimationFrame(animate);
      }

      init();
      animate();
    };
  }, [canvasRef]);
  return (
    <div className={picelrain.main}>
      <div className={picelrain.wrapper}>
        <canvas ref={canvasRef} id="canvas1" />
      </div>
    </div>
  );
};
export default PixelRainComponent;
